def dis(s,g):
    s_i=int(s)%70
    s_j=int(int(s)/70)
    g_i=int(g)%70
    g_j=int(int(g)/70)
    i=abs(g_i-s_i)
    j=abs(g_j-s_j)
    if i==0:
        return j*10
    if j==0:
        return i*10
    else:
        if i<j:
            l=i*14+(j-i)*10
        else:
            l=j*14+(i-j)*10
        return l

